import React from 'react';

class FractalCanvas extends React.Component {

    constructor(props) {
        super(props);
        this.canvas = React.createRef();
    }

    render() {
        return(
            <div>
             <canvas 
               className="visualizer"
               width={500}
               height={500}
               ref={this.canvas}
             />
            </div>
        )
    }
} // end of FractalCanvas class

export default FractalCanvas;
